import { Component } from '@angular/core';

import { LanguageService } from '@igo2/core';

@Component({
  selector: 'app-auth-form',
  templateUrl: './auth-form.component.html',
  styleUrls: ['./auth-form.component.scss']
})
export class AppAuthFormComponent {
  private idsActivity: string[] = [];

  constructor(private languageService: LanguageService) {}
}
<mat-card>
  <mat-card-subtitle>Auth</mat-card-subtitle>
  <mat-card-title>Authentification</mat-card-title>
  <mat-card-content>
    <li>Dependencies: ConfigService, LanguageService</li>

    <br>
    See the <a href="https://github.com/infra-geo-ouverte/igo2-lib/tree/master/demo/src/app/auth/auth-form">code of this example</a><br>
    See auth section of the <a href="https://github.com/infra-geo-ouverte/igo2-lib/tree/master/demo/src/environments"> environment config</a>
  </mat-card-content>
</mat-card>

<igo-auth-form></igo-auth-form>
